import React from 'react';

// Pictures
import iconComplete from '../../images/icon-complete.svg';

function Complete() {
  return (
    <div className='w-[45%] h-full flex items-center'>
      <dir className="w-full flex flex-col">
        <div>
          <img src={iconComplete} alt="" />
        </div>
      </dir>
    </div>
  )
}
export default Complete;
